import React, { useState } from "react";
import styled from "styled-components";
import Button from "../Button";
import Input from "../Input";
import Modal from "../Modal";
const Wrapper = styled.div`
  width: 100%;
  padding: 0 3rem;
`;

const RenderWrapper = props => {
  let isModalOpen = useState()

  const fetchData = event => {
    event.preventDefault();
    props.fetchGeolocation();
  };

  const toggleModal = () => {
    alert("Toggling modal");
  };

  return (
    <Wrapper>
      <div className="Display-form">
        <div className="Card-text">
          <h1 className="Title">Weather API</h1>
          <small className="Author">Author: Diego Matheus</small>
        </div>
        <form onSubmit={event => fetchData(event)}>
          <Input placeholder="Miami Florida" id="input" />
          <Button>Hello</Button>
        </form>
        <button onClick={toggleModal}>Toggle Modal</button>
      </div>
      <div className="Modal-wrapper">
        <Modal />
      </div>
    </Wrapper>
  );
};

export default RenderWrapper;
